import React from 'react';
import * as ReactDOMClient from "react-dom/client";

function Form (){
  return(
  <input placeholder='AFNFHJHF'/>
  )
}

export default function MyApp(){
  return(
  <div>
    <Form />
  </div>
  )
}
const app = ReactDOMClient.createRoot(document.getElementById("root"));
app.render(<MyApp />);
